import 'video.js/dist/video-js.css';
import VideoPlayer from "./VideoPlayer.jsx";
import DescriptionText from "./DescriptionText.jsx";
import DescriptionPane from "./DescriptionPane"

import "./App.css"

class App extends React.Component {


  render() {
    var videoOptions = {
      controls: true, preload: "auto", autoplay: false, height: 400, width: 600, controlBar: {
        fullscreenToggle: false
      }, sources: [{ src: "//vjs.zencdn.net/v/oceans.mp4", type: "video/mp4" }]
    }

    return <div id="main-container">
      <div id='inner-main-container'>
        <VideoPlayer id="video-player" {...videoOptions} />
        {/* <DescriptionText></DescriptionText> */}
        <DescriptionPane></DescriptionPane>
      </div>
    </div>

  }

  componentDidMount() {

    // var player = videojs('my-player', videoOptions);
    // player.disablePictureInPicture = true
  }
}

export default App
